<script type="text/javascript">
    var snake = new Vue({
        el: '#snake',
        data: {
            direction: 'right',
            bean: {
                row: 20,
                col: 30
            },
            interval: '',
            snake: [{
                    row: 0,
                    col: 0
                },
                {
                    row: 0,
                    col: 1
                },
                {
                    row: 0,
                    col: 2
                },
                {
                    row: 0,
                    col: 3
                },
                {
                    row: 0,
                    col: 4
                },
                {
                    row: 0,
                    col: 5
                },
                {
                    row: 0,
                    col: 6
                },
            ]
        },
        watch: {
            snake: function(val, oldVal) {
                for (var index in this.snake) {
                    var rowId = this.snake[index].row;
                    var row = document.getElementsByTagName('tr')[rowId];
                    var colId = this.snake[index].col;
                    row.children[colId].style.backgroundColor = 'red';
                }
                // var beanTarget = this.bean;
                // 
                // var head=snake.snake[snake.snake.length-1];
                // if(beanTarget.row-head.row<0){
                //     snake.direction='up';
                // }else if(beanTarget.row-head.row>0){
                //     snake.direction='down';
                // }else{
                //     if(beanTarget.col-head.col<0){
                //         snake.direction='left';
                //     }else if(beanTarget.col-head.col>0){
                //         snake.direction='right'
                //     }
                // }

            },
            bean: function(newBean, oldBean) {
                //
                var row = document.getElementsByClassName('row')[oldBean.row];
                var col = row.children[oldBean.col];
                col.style.backgroundColor = 'white';

                //
                var row1 = document.getElementsByClassName('row')[newBean.row];
                var col1 = row1.children[newBean.col];
                col1.style.backgroundColor = 'red';



            }
        },
        methods: {

            endGame: function() {
                clearInterval(this.interval);
            },
            startGame: function() {
                this.interval = setInterval(function() {

                    //
                    var head = snake.snake[snake.snake.length - 1];
                    var newRowId;
                    var newColId;

                    if (snake.direction === 'right') {
                        newRowId = head.row;
                        newColId = head.col + 1;
                    } else if (snake.direction === 'down') {
                        newRowId = head.row + 1;
                        newColId = head.col;
                    } else if (snake.direction === 'up') {
                        newRowId = head.row - 1;
                        newColId = head.col;
                    } else if (snake.direction === 'left') {
                        newRowId = head.row;
                        newColId = head.col - 1;
                    }
                    snake.snake.push({
                        row: newRowId,
                        col: newColId
                    })

                    if (head.row == snake.bean.row && head.col == snake.bean.col) {

                        snake.snake.unshift(snake.bean)
                        snake.createNewBean();
                        return;
                    }
                    //
                    var item = snake.snake.shift();
                    if (item == undefined) {
                        clearInterval(interval);
                    }
                    var rowId = item.row;
                    var colId = item.col;
                    var row = document.getElementsByTagName('tr')[rowId];
                    row.children[colId].style.backgroundColor = 'white';


                }, 50)
            },
            createNewBean: function() {
                var newBeanX = parseInt(Math.random() * 100);
                var newBeanY = parseInt(Math.random() * 100);
                snake.bean = {
                    row: newBeanX,
                    col: newBeanY
                };
            }
        },

        created() { //
            document.onkeydown = function(e) {
                let key = window.event.keyCode;
                if (key === 37) {
                    if (snake.direction != 'right') {
                        snake.direction = 'left';
                    }
                } else if (key === 38) {
                    if (snake.direction != 'down') {
                        snake.direction = 'up';
                    }
                } else if (key === 39) {
                    if (snake.direction != 'left') {
                        snake.direction = 'right';
                    }
                } else if (key === 40) {
                    if (snake.direction != 'up') {
                        snake.direction = 'down';
                    }
                }
            };
        }
    })

    window.onload = function() {
        snake.createNewBean();
    }
</script>
